import { Link } from "react-router-dom";

export default function Header() {
  return (
    <header className="app-links">
      <nav className="app-nav">
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/planets">Planets</Link>
        </li>
        <li>
          <Link to="/rlanets">Planets</Link>
        </li>
      </nav>
    </header>
  );
}
